    false,nt"url": null,nt"notes": "Energy and mineral resources map of the
    Reno quadrangle showing eight categories of potential sand and gravel sources, symbols
    for three levels of sand and gravel production, three categories of decomposed granite
    sources, three categories of rock products sources, geothermal areas, hot water
    isotherm, area containing inactive mines and numerous metal prospects, known occurrences
    of polymetallic mineralization, known silver prospects, known copper prospects,
    and a placer gold mine. Other maps in the NBMG Urban Map series for the Reno Quadrangle
    include Tinted relief (4Aa), Slope (4Ab), Land use (4Ac), Soils (4Ad), Vegetation
    (4Ae), Hydrology (4Af), Geology (4Ag), Earthquake hazards (4Ai), and Physical properties
    (4Aj). See figure 3 for other quadrangles in the Urban Map series.",nt"license_title":
